💡 poslechnout si zajímavé příběhy pamětníků, kteří zasvětili svůj život skautingu;
💡 podívat se na zbrusu nový dokument z naší dílny Se Sovětským svazem na věčné časy, který je věnovaný srpnu 1968 v Olomouci;
💡 zahrát si kvíz o ceny, kde vyhrává každý;
